        <li className="p-3 bg-white dark:bg-gray-700 dark:text-white rounded shadow">Reporte 1</li>
        <li className="p-3 bg-white dark:bg-gray-700 dark:text-white rounded shadow">Reporte 2</li>
      </ul>
    </div>
  );
}
